import React from 'react';
import { NavigationContainer } from '@react-navigation/native';
import { createBottomTabNavigator } from '@react-navigation/bottom-tabs';
import { Ionicons } from '@expo/vector-icons';

// Screens
import TimetableScreen from './src/screens/TimetableScreen';
import TasksScreen from './src/screens/TasksScreen';
import MedicineScreen from './src/screens/MedicineScreen';
import ProgressScreen from './src/screens/ProgressScreen';

// Context Providers
import { AppProvider } from './src/context/AppContext';
import { TimetableProvider } from './src/context/TimetableContext';
import { TasksProvider } from './src/context/TasksContext';
import { MedicationProvider } from './src/context/MedicationContext';
import { ProgressProvider } from './src/context/ProgressContext';



// Navigation types
export type RootTabParamList = {
  Timetable: undefined;
  Tasks: undefined;
  Medications: undefined;
  Progress: undefined;
};

const Tab = createBottomTabNavigator<RootTabParamList>();

const MainTabNavigator = () => {
  return (
    <Tab.Navigator
      screenOptions={({ route }) => ({
        tabBarIcon: ({ focused, color, size }) => {
          let iconName: string;

          switch (route.name) {
            case 'Timetable':
              iconName = 'calendar-outline';
              break;
            case 'Tasks':
              iconName = 'checkmark-circle-outline';
              break;
            case 'Medications':
              iconName = 'medical-outline';
              break;
            case 'Progress':
              iconName = 'analytics-outline';
              break;
            default:
              iconName = 'help-outline';
          }

          // Add subtle animation for focused state
          const animatedValue = new Animated.Value(focused ? 1 : 0.8);

          Animated.timing(animatedValue, {
            toValue: focused ? 1 : 0.8,
            duration: 200,
            easing: Easing.out(Easing.quad),
            useNativeDriver: true,
          }).start();

          return (
            <Animated.View style={{ transform: [{ scale: animatedValue }] }}>
              <Ionicons name={iconName as any} size={size} color={color} />
            </Animated.View>
          );
        },
        tabBarActiveTintColor: '#007bff',
        tabBarInactiveTintColor: '#6c757d',
        tabBarStyle: {
          backgroundColor: '#ffffff',
          borderTopWidth: 1,
          borderTopColor: '#e9ecef',
          paddingBottom: 5,
          paddingTop: 5,
          height: 60,
          elevation: 8,
          shadowColor: '#000',
          shadowOffset: { width: 0, height: -2 },
          shadowOpacity: 0.1,
          shadowRadius: 4,
        },
        tabBarLabelStyle: {
          fontSize: 12,
          fontWeight: '500',
        },
        headerStyle: {
          backgroundColor: '#ffffff',
          borderBottomWidth: 1,
          borderBottomColor: '#e9ecef',
        },
        headerTitleStyle: {
          fontSize: 18,
          fontWeight: '600',
          color: '#212529',
        },
        headerTintColor: '#007bff',
        // Add smooth tab transition
        tabBarHideOnKeyboard: true,
        tabBarVisibilityAnimationConfig: {
          show: {
            animation: 'timing',
            config: {
              duration: 200,
            },
          },
          hide: {
            animation: 'timing',
            config: {
              duration: 200,
            },
          },
        },
      })}>
      <Tab.Screen 
        name="Timetable" 
        component={TimetableScreen}
        options={{
          title: 'Schedule',
          headerShown: false, // TimetableScreen has its own header
        }}
      />
      <Tab.Screen 
        name="Tasks" 
        component={TasksScreen}
        options={{
          title: 'Tasks',
          headerShown: false, // TasksScreen has its own header
        }}
      />
      <Tab.Screen 
        name="Medications" 
        component={MedicineScreen}
        options={{
          title: 'Medications',
          headerShown: false, // MedicineScreen has its own header
        }}
      />
      <Tab.Screen 
        name="Progress" 
        component={ProgressScreen}
        options={{
          title: 'Progress',
          headerShown: false, // ProgressScreen has its own header
        }}
      />
    </Tab.Navigator>
  );
};

const RootNavigator = () => {
  return (
    <Stack.Navigator
      screenOptions={{
        headerShown: false,
        ...customTransition,
      }}>
      <Stack.Screen 
        name="MainTabs" 
        component={MainTabNavigator}
        options={{
          ...TransitionPresets.SlideFromRightIOS,
        }}
      />
    </Stack.Navigator>
  );
};

const App: React.FC = () => {
  const navigationRef = useRef<NavigationContainerRef<RootTabParamList>>(null);

  useEffect(() => {
    // Set navigation reference for the service
    navigationService.setNavigationRef(navigationRef);

    // Handle deep links
    const handleDeepLink = (url: string) => {
      navigationService.handleDeepLink(url);
    };

    // Listen for deep links when app is already open
    const linkingListener = Linking.addEventListener('url', ({ url }) => {
      handleDeepLink(url);
    });

    // Handle deep link when app is opened from closed state
    Linking.getInitialURL().then((url) => {
      if (url) {
        handleDeepLink(url);
      }
    });

    return () => {
      linkingListener.remove();
    };
  }, []);

  const linking = {
    prefixes: ['productivityapp://'],
    config: {
      screens: {
        MainTabs: {
          screens: {
            Timetable: 'timetable',
            Tasks: 'tasks',
            Medications: 'medications',
            Progress: 'progress',
          },
        },
      },
    },
  };

  return (
    <AppProvider>
      <TimetableProvider>
        <TasksProvider>
          <MedicationProvider>
            <ProgressProvider>
              <NavigationContainer
                ref={navigationRef}
                linking={linking}
                onReady={() => {
                  console.log('Navigation ready');
                }}>
                <OfflineIndicator />
                <RootNavigator />
              </NavigationContainer>
            </ProgressProvider>
          </MedicationProvider>
        </TasksProvider>
      </TimetableProvider>
    </AppProvider>
  );
};

export default App;
